import React from "react";

import { Container, Grid, Paper, Typography } from "@material-ui/core";


const SignUp = () => {

    return (
        <div>
            <Container>
                <Paper elevation={1}>
                    <Grid container>
                        <p> Sign Up Page</p>

                        <Grid item>
                            <form>
                                <Typography variant="subtitle1"></Typography>
                            </form>
                        </Grid>
                    </Grid>
                </Paper>
            </Container>
        </div>
    )
}

export default SignUp;
